import React from 'react'
import { connect } from 'react-redux'


const AnswerPoll = ({ data }) => {

  return (
    <>
      <p>{data.id}</p>
      <p>{data.firstQuestion}</p>
      <p>{data.firstQuestion}</p>
    </>
  )
}

function mapStateToProps({ authedUser, polls }) {
  return {
    authedUser,
    polls
  }
}

export default connect(mapStateToProps)(AnswerPoll)
